DATA_F7659E:
	db $02
	db "",$00
	db "    Hello, dearies. I'm Mrs.",$00
	db "   Wrinkly Kong, Headmistress",$00
	db "      here at Kong Kollege.",$00
	db "",$00
	db "",$00

DATA_F765F9:
	db " I'm available to teach courses",$00
	db "  on how to play this game, or",$00
	db "  you can just pop in when you",$00
	db "  want to save your little old ",$00
	db "   game. Now then, how can I ",$00
	db "           help you?",$00

DATA_F766AA:
	db "",$00
	db "  When you see Kaptain K.Rool,",$00
	db " can you ask him if he has done",$00
	db "         his homework?",$00
	db "",$00
	db "",$00

DATA_F76703:
	db "",$00
	db " Hurry along! School is nearly",$00
	db " finished! You need to study a",$00
	db " little more if you're going to",$00
	db "      beat the Kremlings!",$00
	db "",$00

DATA_F7677D:
	db "",$00
	db " Those naughty crocodiles! All",$00
	db "  they want to learn is how to",$00
	db " fight and squash monkeys, Tsk!",$00
	db "",$00
	db "",$00

DATA_F767DE:
	db "",$00
	db "    Have you been to see my",$00
	db "  husband Cranky? He complains",$00
	db "   a little, but he does know",$00
	db "  everything about this island.",$00
	db "",$00

DATA_F76859:
	db "",$00
	db "    Come on in and sit down,",$00
	db "  children. I'm sure all that",$00
	db "  running around has made you",$00
	db "            tired.",$00
	db "",$00

DATA_F768C7:
