	db " Well! Just look at those sums",$00
	db "   those Kremlings have done.",$00
	db "          Disgraceful!",$00
	db "",$00
	db "",$00

DATA_F7691E:
	db "",$00
	db " You're looking a little weary",$00
	db "  dear. Would you like to save",$00
	db "           your game?",$00
	db "",$00
	db "",$00

DATA_F76975:
	db "",$00
	db "  I hope you're better behaved",$00
	db "  than those reptiles. Why, I",$00
	db " even caught one sharpening his",$00
	db "   sword in class yesterday!",$00
	db "",$00

DATA_F769F1:
